// XReport.js (Web version of XReportGenerator)
import React, { useEffect, useState } from "react";

const XReport = () => {
  const [reportData, setReportData] = useState([]);
  const [startHour, setStartHour] = useState(0);
  const [endHour, setEndHour] = useState(23);

  useEffect(() => {
    const fetchReport = async () => {
      try {
        const res = await fetch(`/api/x-report?start=${startHour}&end=${endHour}`);
        const json = await res.json();
        setReportData(json);
      } catch (err) {
        alert("Failed to fetch X-Report data.");
      }
    };

    fetchReport();
  }, [startHour, endHour]);

  const hours = Array.from({ length: 24 }, (_, i) => i);

  return (
    <div style={{ padding: 20 }}>
      <h2>📊 X-Report - Hourly Sales Breakdown</h2>
      <div style={{ marginBottom: 20 }}>
        <label>Start Hour: </label>
        <select value={startHour} onChange={(e) => setStartHour(parseInt(e.target.value))}>
          {hours.map((h) => (
            <option key={h} value={h}>{h}:00</option>
          ))}
        </select>
        <label style={{ marginLeft: 10 }}>End Hour: </label>
        <select value={endHour} onChange={(e) => setEndHour(parseInt(e.target.value))}>
          {hours.map((h) => (
            <option key={h} value={h}>{h}:00</option>
          ))}
        </select>
      </div>

      <table border="1" cellPadding="5" cellSpacing="0">
        <thead>
          <tr>
            <th>Hour</th>
            <th>Transactions</th>
            <th>Sales Revenue ($)</th>
            <th>Total Sales ($)</th>
            <th>Returns ($)</th>
            <th>Drinks Sold</th>
            <th>Voids ($)</th>
            <th>Discards ($)</th>
            <th>Payment Methods</th>
          </tr>
        </thead>
        <tbody>
          {reportData.length === 0 ? (
            <tr><td colSpan="9">No data available.</td></tr>
          ) : (
            reportData.map((row, index) => (
              <tr key={index}>
                <td>{row.hour}:00 - {row.hour}:59</td>
                <td>{row.total_transactions}</td>
                <td>{row.sales_revenue.toFixed(2)}</td>
                <td>{row.total_sales.toFixed(2)}</td>
                <td>{row.total_returns.toFixed(2)}</td>
                <td>{row.drink_sales}</td>
                <td>{row.voids.toFixed(2)}</td>
                <td>{row.discards.toFixed(2)}</td>
                <td>{row.payment_methods}</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
};

export default XReport;
